import React, { Fragment } from 'react';

const PostForm = ({
  title,
  titleDesc,
  imageUrl,
  content,
  id,
  handleInputChange,
}) => {
  return (
    <Fragment>
      <img src={imageUrl} alt={title} />
      <div className="fied-container">
        <label>_id: </label>
        <input
          name="id"
          onChange={(e) => handleInputChange(e)}
          type="text"
          value={id} 
        />
      </div>
      <div className="fied-container">
        <label>Title: </label>
        <input
          name="title"
          onChange={(e) => handleInputChange(e)}
          type="text"
          value={title} 
        />
      </div>
      <div className="fied-container">
        <label>Description: </label>
        <input
          name="titleDesc"
          onChange={(e) => handleInputChange(e)}
          type="text"
          value={titleDesc} 
        />
      </div>
      <div className="fied-container">
        <label>ImageUrl: </label>
        <input
          name="imageUrl"
          onChange={(e) => handleInputChange(e)}
          type="text"
          value={imageUrl} 
        />
      </div>
      <div className="fied-container">
        <label>Contenu: </label>
        <textarea
          name="content"
          onChange={(e) => handleInputChange(e)}
          type="text"
          value={content}
        />
      </div>
    </Fragment>
  )
};

export { PostForm };
